import React,{useEffect,useState} from 'react';
import axios from 'axios';

const Home = (props) => {
    const [state,setState] = useState([]);
    useEffect (()=>{
        axios.get ('https://fakestoreapi.com/products')
        .then(res =>{
            console.log(res);
            setState(res.data)
        })
    },[])
  return (

    <ul>
    {Array.from(state).map((item,index) => {
      return (
      <>
      <div key={index}>
      <li>{item.name}</li>
      <li>{item.title}</li>
      <li>{item.job}</li>
      <li>{item.message}</li>
      <li>{item.success}</li>


      </div>
      </>
      )
    })}
    </ul>
  )

}

export default Home;
